import React from 'react';
import '../../App.css';
import HeroSection from '../HeroSection'
import Cards from '../Cards';
import Footer from '../Footer';

function Home () {
    return (
        <>
            <HeroSection id="aboutme" />
            <Cards id="projects" />
            <div id="otherthing" >
                <h1> this is the other thing </h1>
            </div>
            <Footer id="footer" />
            <div id="thing" >
                <h1> this is the thing </h1>
            </div>
        </>
    )
}

export default Home;
